import changeTodoDescription from '../actions/changeTodoDescription.action';
import changeTodoResponsible from '../actions/changeTodoResponsible.action';
import changeTodoPriority from '../actions/changeTodoPriority.action';
import submit from '../actions/submitCreateTodo.action';

const createTodoContainer = {
    mapStateToProps: state => {
        return {
            resposible: state.createTodo.todoResponsible,
        }
    },
    mapDispatchToProps: dispatch => {
        return {
            changeTodoDescription: (event) => dispatch(changeTodoDescription(event)),
            changeTodoResponsible: (event) => dispatch(changeTodoResponsible(event)),
            changeTodoPriority: (event) => dispatch(changeTodoPriority(event)),
            submit: (event) => dispatch(submit(event)),
        }
    }
}

export default createTodoContainer;
